import React from 'react';
import { Link } from 'react-router-dom';

interface Investor {
  id: number;
  first_name: string;
  last_name: string;
  date_of_birth: string;
  phone_number: string;
  street_address: string;
  state: string;
  zip_code: string;
}

const InvestorList: React.FC = () => {
  const [investors, setInvestors] = React.useState<Investor[]>([]);

  React.useEffect(() => {
    fetch('http://localhost:3000/api/investors')
      .then(res => res.json())
      .then(data => setInvestors(data));
  }, []);

  return (
    <div style={{ maxWidth: 800, margin: '0 auto', padding: 20 }}>
      <h1>Investors</h1>
      <Link to="/investors/add">Add New Investor</Link>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Date of Birth</th>
            <th>Phone</th>
            <th>Address</th>
            <th>State</th>
            <th>Zip Code</th>
          </tr>
        </thead>
        <tbody>
          {investors.map(inv => (
            <tr key={inv.id}>
              <td>
                <Link to={`/${inv.id}`}>{inv.first_name} {inv.last_name}</Link>
              </td>
              <td>{inv.date_of_birth}</td>
              <td>{inv.phone_number}</td>
              <td>{inv.street_address}</td>
              <td>{inv.state}</td>
              <td>{inv.zip_code}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default InvestorList;
